entry.value:
MERGE into lakehouse.${integration_schema}.${integration_table}  t
USING ( 
        select * 
        from  lakehouse.${landing_schema}.${landing_table} a  where op_no >= ${new_max_src_scn}
        QUALIFY ROW_NUMBER() OVER (
            PARTITION BY ${src_key_name}
            ORDER BY op_no desc
          ) = 1 ) s 
on  t.${src_key_name}= s.${src_key_name}
when MATCHED THEN UPDATE SET  ${v_list_col_upd}
WHEN NOT MATCHED THEN INSERT (${v_list_col_ins_tar}) values (${v_list_col_ins_src})
